import logo from '../../images/Logo.svg';

function Header({ isRegisterPage }) {
  return (
    <header className="header">
      <a href="/main">
        <img
          src={logo}
          alt="Логотип"
          className="logo button-clickable"
					id='logo'
        />
      </a>
      <a href={isRegisterPage ? "/sign-in" : "/sign-up"}
      className="header__link button-clickable"
      >
        {isRegisterPage ? "Войти" : "Регистрация"}
      </a>
    </header>
  );
}

export default Header;
